import React from 'react';
import Card from './Card'


const CardList = ({gundams}) => {

	return (
		 		<div className='pa5' >
					{
						gundams.map((user, i) => {
							return (
								<Card
								key={i}
								id={gundams[i].id}
								image={gundams[i].image}
								name={gundams[i].name}
								faction={gundams[i].faction}
								description={gundams[i].description}
								weight={gundams[i].weight}
								/>
								);
						})
					}
				</div>
		);
}

export default CardList;
